import React from "react";
import './MyName.css'
import './PersonalInfo'
import PersonalInfo from "./PersonalInfo";

function MyName() {
    return (
        <div className="MyName">
            <p className="MyName-test">Welcome! {document.getElementsByName("fName")} {document.getElementsByName("lName")}</p>
        </div>
    );
}

export default MyName
